      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN - col0 * + col0 * - + col1 * - - col1 AND ( - col2 + - col0 + - col1 / 67 );
  - name: tab2

outputs:
  - name: q6382.out
    data: |
